padding: 0px 0px 64px;
gap: 96px;
position: absolute;
width: 1512px;
height: 1167.5px;
left: 0px;
top: 120px;
`
const Top=styled.div`
width: 1512px;
height: 795.5px;
background: #061237;
flex: none;
order: 0;
flex-grow: 0;
`

const Bottom=styled.div`
width: 1120px;
height: 212px;
flex: none;
order: 1;
flex-grow: 0;
`
