        <WhiteDiv></WhiteDiv>
        <Vector></Vector>
        <BottomDiv></BottomDiv>
      </Top>
      <Bottom>
        <Text>Trusted and loved by the worldâ€™s best teams</Text>
        <Company></Company>
      </Bottom>
